#include <stdlib.h>
#include <math.h>
#include "moeaframework.h"
#include <stdio.h>
#include <time.h>


#define MAXV            1001    /* maximum number of vertices  replaced by (MAX_RANKS+1)*(MAX_PER_RANK+1)*/
#define MAXDEGREE       100     /* maximum vertex outdegree   replaced by MAX_PER_RANK */
#define PQ_SIZE         1001    /* must be greater/equal than than MAXV */
#define TRUE    1
#define FALSE   0

typedef int item_type;

typedef struct 
{
   int edges[MAXV][MAXDEGREE];   /* adjacency info */
   int degree[MAXV];             /* outdegree of each vertex */
   int nvertices;                /* number of vertices in graph */
   int nedges;                   /* number of edges in graph */
   float weight[MAXV];
} graph;

typedef struct 
{
        item_type q[PQ_SIZE+1];     /* body of queue */
        int n;                      /* number of queue elements */
} priority_queue;

float optimized_function(int inPerm[]);
void topsort(graph *g, int inPerm[],int inverPerm[], int sorted[]);
void compute_indegrees(graph *g, int in[]);
graph* generate_graph(void);
float evaluate_permutation(graph *g, int sorted[]);

void pq_init(priority_queue *q);
int pq_parent(int n);
int pq_young_child(int n);
void bubble_up(priority_queue *q, int inverPerm[], int p);
void bubble_down(priority_queue *q, int inverPerm[], int p);
void pq_insert(priority_queue *q, int inverPerm[], item_type x);
void pq_swap(priority_queue *q, int i, int j);
item_type extract_min(priority_queue *q, int inverPerm[]);
int empty_pq(priority_queue *q);
void print_pq(priority_queue *q);

int random_int(int low, int high);
void random_permutation(int a[],int n);
void inverse_permutation(int a[],int b[], int n);

int nvars;
int nobjs;

/**
 * Function for evaluating the DTLZ2 problem.
 */
void evaluate(int* vars, double* objs) 
{
    // Uzima se negativna vrednost jer MOEA algoritam koristi minimazaciju cene resenja, a nama je potrebna maksimizacija cene
	objs[0] = -optimized_function(vars);
}

/**
 * The main routine for parsing the decision variable inputs, evaluating the
 * problem and printing the objectives.
 */
int main(int argc, char* argv[]) 
{
	if (argc <= 1) 
    {
		nobjs = 1;
		nvars = 1000;
	} 
    else if (argc >= 3) 
    {
		nobjs = atoi(argv[2]);
		nvars = atoi(argv[1]);
	} 

	int vars[nvars];
	double objs[nobjs];


#ifdef USE_SOCKET
	MOEA_Init_socket(nobjs, 0, NULL);
#else
	MOEA_Init(nobjs, 0);
#endif

	while (MOEA_Next_solution() == MOEA_SUCCESS) 
    {

		MOEA_Read_permutation(nvars, vars);
		evaluate(vars, objs);
		MOEA_Write(objs, NULL);
	}
	
	MOEA_Terminate();

	return EXIT_SUCCESS;
}

float optimized_function(int inPerm[])
{
  int inverPerm[MAXV], out[MAXV];
  graph* g;
  float fitness=0.0;

  g=generate_graph();

  inverse_permutation(inPerm,inverPerm, (*g).nvertices);

  topsort(g,inPerm,inverPerm,out);
  fitness=evaluate_permutation(g,out);

  return fitness;
}

